import React,{useState} from 'react';
import {
    Container,
    Form,
    FormGroup,
    Label,
    Input
}from 'reactstrap';

export const Forms=()=>{
    const [name,setState]=useState('');
    const [college,setCollege]=useState('');

    // const onChange=(e)=>{
    //     return(
    //         setState([e.target.name]=e.target.value)
    //     )
    // }
    return(
        <Container>
            <Form>
                <FormGroup>
                    <Label>Name</Label>
                    <Input type='text' onChange={()=>setName(e.target.value)} value={name}/>
                    <Label>College</Label>
                    <Input type="text" onChange={()=>setCollege(e.target.value)} value={college}/>
                </FormGroup>
            </Form>
        </Container>
    )
}
